// bubble sort
void bubble()
{
	int i, j, temp;

	for(i=N-1; i>=0; i--)
	{
		for(j=1; j<=i; j++)
		{
			if(a[j-1] > a[j])
			{
				temp = a[j-1];
				a[j-1] = a[j];
				a[j] = temp;
			}
		}
	}
	//cout << "\nThe sorted elements of one-dimensional array\n";
//	for(i=0; i<N; i++)
	//	cout << "a[" << i << "] = " << a[i] << " ";

}

