//Sort_Insertion
void insertion()
{
    int  i, j, index;

	for(i=1; i<N; i++)
	{
		index = a[i];
		j = i;
		while((j>0) && (a[j-1]>index))
		{
			a[j] = a[j-1];
			j = j - 1;
		}
		a[j] = index;
	}
//	cout << "\nThe sorted elements of one-dimensional array\n";
	//for(i=0; i<N; i++)
		//cout << "a[" << i << "] = " << a[i] << " ";


}

