//Sort_Selection
void selection()
{
    int i, j, min, imin;

	for(i=0; i<N-1; i++)
	{
		min = a[i];
		imin = i;
		for(j=i+1; j<N; j++)
		{
			if(min>a[j])
			{
				min = a[j];
				imin = j;
			}
		}
		a[imin] = a[i];
		a[i] = min;
	}
	//cout << "\nThe sorted elements of one-dimensional array\n";
	//for(i=0; i<N; i++)
		//cout << "a[" << i << "] = " << a[i] << "\n";

}

